query:
SELECT ?uri ?string
WHERE
{ 
	?uri  <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Mountain>  .
        ?uri <http://dbpedia.org/ontology/elevation> ?elevation .
        OPTIONAL {?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string . FILTER (lang(?string) = 'en') }
} ORDER BY DESC(?elevation) LIMIT 1

SELECT DISTINCT ?uri ?string
WHERE 
{
	?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Organisation> .
        ?uri <http://dbpedia.org/property/foundation> ?date .
        FILTER regex(?date,'^1950') .
	OPTIONAL {?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string . FILTER (lang(?string) = 'en') }
}

SELECT ?uri ?string
WHERE 
{
	?books <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Book> .
        ?books <http://dbpedia.org/ontology/author> ?uri .
        ?books <http://www.w3.org/2000/01/rdf-schema#label> 'The Pillars of the Earth'@en .
	OPTIONAL {?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string . FILTER (lang(?string) = 'en') }
}

SELECT ?uri ?string
WHERE 
{
	?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/class/yago/FemaleHeadsOfGovernment.
>        ?uri <http://dbpedia.org/property/office> ?office .
        FILTER regex(?office, 'Chancellor of Germany').        
        OPTIONAL {?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string . FILTER (lang(?string) = 'en') }
}

SELECT DISTINCT ?uri ?string
WHERE 
{
	?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Film.
	{> ?uri <http://dbpedia.org/property/starring> <http://dbpedia.org/resource/Tom_Cruise> . }
        UNION
        { ?uri <http://dbpedia.org/ontology/starring> <http://dbpedia.org/resource/Tom_Cruise> . }
	OPTIONAL {?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string . FILTER (lang(?string) = 'en') }
}

SELECT DISTINCT ?uri ?string
WHERE 
{
	?film <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Film> .
        ?film <http://dbpedia.org/ontology/starring> ?actors .
        ?actors <http://xmlns.com/foaf/0.1/name> 'Natalie Portman'@en .
        ?film <http://dbpedia.org/ontology/producer> ?uri .
	OPTIONAL {?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string . FILTER (lang(?string) = 'en') }
}

SELECT ?uri ?string
WHERE
{ 
	?uri  <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Country>  .
        ?uri <http://dbpedia.org/ontology/language> ?language .
	OPTIONAL {?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string . FILTER (lang(?string) = 'en')}		     
} ORDER BY DESC(count(?language)) LIMIT 1

SELECT DISTINCT ?uri ?string
WHERE 
{
	?single <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Single> .
        ?single <http://dbpedia.org/ontology/album> ?uri .
        ?single <http://xmlns.com/foaf/0.1/name> 'Last Christmas'@en .
        OPTIONAL {?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string . FILTER (lang(?string) = 'en') }
}

SELECT DISTINCT ?uri ?string
WHERE 
{
      { ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://xmlns.com/foaf/0.1/Person.>        
        ?uri <http://xmlns.com/foaf/0.1/givenName> 'Dana'@en. }
      UNION 
      { ?uri <http://dbpedia.org/property/alias> ?alias . 
        FILTER regex(?alias,'Dana') . }
       OPTIONAL {?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string . FILTER (lang(?string) = 'en') }       
}

SELECT ?uri ?string
WHERE 
{
	?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/President> .
	?uri <http://dbpedia.org/ontology/orderInOffice> '5th President of the United States'@en .
        OPTIONAL {?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string . FILTER (lang(?string) = 'en') }
}

SELECT DISTINCT ?uri ?string
WHERE 
{ 
      ?country <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Country.
>      { ?country <http://dbpedia.org/ontology/language> ?uri . } 
      UNION 
      { ?uri <http://dbpedia.org/ontology/spokenIn> ?country . }
      FILTER (regex(?country, 'Estonia')).
      OPTIONAL {?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string . FILTER (lang(?string) = 'en') }
}

SELECT DISTINCT ?uri ?string
WHERE 
{
	?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Software> .
      { ?uri <http://dbpedia.org/property/publisher> 'Mean Hamster Software'@en . }
      UNION 
      { ?uri <http://dbpedia.org/ontology/publisher> res:Mean_Hamster_Software . }
	OPTIONAL {?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string . FILTER (lang(?string) = 'en') }
}

SELECT DISTINCT ?uri ?string
WHERE 
{
	?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Film> .
        ?uri <http://dbpedia.org/ontology/producer> ?producer .
        ?producer <http://www.w3.org/2000/01/rdf-schema#label> 'Hal Roach'@en .
	OPTIONAL {?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string . FILTER (lang(?string) = 'en') }
}

SELECT DISTINCT ?uri ?string
WHERE 
{ 
	?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/City.
>      { ?uri <http://dbpedia.org/property/population> ?population. } 
        UNION 
      { ?uri <http://dbpedia.org/property/population>Urban ?population. }
	FILTER (<http://www.w3.org/2001/XMLSchema#integer(?population)> > 2000000) .
	OPTIONAL {?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string . FILTER (lang(?string) = 'en') }
}

SELECT DISTINCT ?uri ?string
WHERE
{
  ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Actor> .
  {   
      ?uri <http://dbpedia.org/ontology/birthPlace> res:Germany .
  }
  UNION 
  {
      ?uri <http://dbpedia.org/ontology/birthPlace> ?city .
      ?city <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/class/yago/StatesOfGermany> . 
  }
  OPTIONAL {?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string . FILTER (lang(?string) = 'en') }
}

PREFIX rdfs:label: <http://www.w3.org/2000/01/rdf-schema#labelgt;
ASK
WHERE> 
{
	?film <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Film> .
        ?film <http://dbpedia.org/ontology/starring> ?actors .
        ?actors rdfs:label 'Christian Bale'@en .
        ?film <http://xmlns.com/foaf/0.1/name> 'Batman Begins'@en
}

SELECT ?uri ?string
WHERE
{ 
	?uri  <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> onto:Company  .
	?uri <http://dbpedia.org/property/industry> res:Aerospace .
        ?uri <http://dbpedia.org/property/industry> res:Nuclear_reactor_technology .
	OPTIONAL {?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string . FILTER (lang(?string) = 'en') }
}

SELECT ?uri ?string
WHERE 
{
	?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Mountain> .
        ?acon <http://www.w3.org/2000/01/rdf-schema#label> 'Nanga Parbat'@en .
        ?acon <http://dbpedia.org/property/elevationM> ?elevation .
        ?uri <http://dbpedia.org/property/elevationM> ?allelevation .
        FILTER (?allelevation > ?elevation) .
	OPTIONAL {?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string . FILTER (lang(?string) = 'en') }
}

SELECT ?uri ?string
WHERE 
{
	?film <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Film> .
        ?film <http://dbpedia.org/ontology/producer> ?uri .
        OPTIONAL {?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string . FILTER (lang(?string) = 'en') }
} ORDER BY DESC(COUNT(?film)) LIMIT 1

SELECT ?uri ?string
WHERE 
{
	?subject <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Software> .
      	?subject <http://www.w3.org/2000/01/rdf-schema#label> 'World of Warcraft'@en .
	?subject <http://dbpedia.org/ontology/developer> ?uri . 
        OPTIONAL {?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string . FILTER (lang(?string) = 'en') }
}

SELECT DISTINCT ?uri ?string
WHERE 
{
        {
          ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/class/yago/PresidentsOfTheUnitedStates.>         
        }
        UNION
        { 
          ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/President.
>          ?uri <http://dbpedia.org/property/title> <http://dbpedia.org/resource/President_of_the_United_States.
>        }
        OPTIONAL {?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string. FILTER (lang(?string) = 'en') }
}

SELECT DISTINCT ?uri ?string
WHERE 
{
	{
		?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/President> .
		?uri <http://dbpedia.org/ontology/birthDate> ?date .
		FILTER regex(?date,'^1945') .
                OPTIONAL {?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string . FILTER (lang(?string) = 'en') }
	}
	UNION
	{
		?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/class/yago/President.
		?uri> <http://dbpedia.org/ontology/birthDate> ?date .
		FILTER regex(?date, '^1945') .
                OPTIONAL {?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string . FILTER (lang(?string) = 'en') }
	}
}

SELECT DISTINCT ?uri ?string
WHERE
{ 
	?uri  <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Company>  .
        ?uri <http://dbpedia.org/property/industry> ?indus .
        FILTER regex(?indus,'Computer') .
        FILTER regex(?indus,'software','i') .
        OPTIONAL {?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string . FILTER (lang(?string) = 'en') }
}

SELECT ?uri ?string
WHERE
{ 	
	?uri  <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Organisation>  .
	?uri <http://dbpedia.org/property/industry> ?indus .
	{ ?uri <http://dbpedia.org/ontology/location> <http://dbpedia.org/resource/Belgium.> } 
        UNION { ?uri <http://dbpedia.org/property/location> <http://dbpedia.org/resource/Belgium.> }
        UNION { ?uri <http://dbpedia.org/property/location>Country> 'Belgium'@en . }
        FILTER (regex(?indus, 'Telecommunication')) .
	OPTIONAL {?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string . FILTER (lang(?string) = 'en') }
}

SELECT DISTINCT ?uri ?string
WHERE 
{
	?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/SoccerClub> .
        { ?uri <http://dbpedia.org/ontology/ground> ?ground . }
        UNION 
        { ?uri <http://dbpedia.org/property/ground> ?ground . }
        FILTER (regex(?ground, 'Spain')) .
        OPTIONAL {?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string. FILTER (lang(?string) = 'en') }
}

SELECT ?uri ?string
WHERE 
{
	?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Mountain> .
        ?uri <http://dbpedia.org/ontology/elevation> ?elevation .
        ?uri <http://dbpedia.org/ontology/locatedInArea> ?area .
        FILTER (regex(?area,'Germany')) .
        OPTIONAL {?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string. FILTER (lang(?string) = 'en') }
} ORDER BY DESC(?elevation) LIMIT 1

SELECT DISTINCT ?uri ?string
WHERE 
{
        ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/class/yago/MonarchsOfTheUnitedKingdom> .
        { ?uri <http://dbpedia.org/ontology/spouse> ?spouse . } UNION { ?spouse <http://dbpedia.org/ontology/spouse> ?uri . }
        ?spouse <http://dbpedia.org/ontology/birthPlace> <http://dbpedia.org/resource/Germany.
>        OPTIONAL {?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string. FILTER (lang(?string) = 'en') }
}

SELECT DISTINCT ?uri ?string
WHERE 
{
        <http://dbpedia.org/resource/Yenisei_River> <http://dbpedia.org/property/country> ?string .
        OPTIONAL { ?uri <http://dbpedia.org/property/commonName> ?name . }
        FILTER regex(?name,?string) .
        OPTIONAL { ?uri <http://dbpedia.org/property/dateEnd> ?date . }
        FILTER (!BOUND(?date))
}

SELECT DISTINCT ?uri ?string
WHERE
{ 
	?uri  <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Country>  .
        ?uri <http://dbpedia.org/ontology/officialLanguage> ?language .
	OPTIONAL {?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string. FILTER (lang(?string) = 'en') }
} HAVING (count(?language) > 2)

SELECT DISTINCT ?uri ?string
WHERE 
{
	?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/class/yago/EuropeanUnionMemberStates> .
        { ?uri <http://dbpedia.org/property/currency> <http://dbpedia.org/resource/Euro> . } 
        UNION 
        { ?uri <http://dbpedia.org/property/currency>Code> ?code . FILTER regex(?code,'EUR') }
        OPTIONAL { ?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string. FILTER (lang(?string) = 'en') }
}

SELECT ?uri ?string
WHERE 
{
	?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/class/yago/StatesOfTheUnitedStates> .
        ?uri <http://dbpedia.org/property/densityrank> ?density
        OPTIONAL {?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string. FILTER (lang(?string) = 'en') }
} ORDER BY ASC(?density) LIMIT 1

ASK
WHERE 
{
	?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/class/yago/PresidentsOfTheUnitedStates> .
        ?uri <http://dbpedia.org/property/name> ?name .
        FILTER (regex(?name, 'Jackson')) .
        OPTIONAL {?uri <http://dbpedia.org/ontology/battle> ?battle .}
        FILTER BOUND(?battle).        
}

SELECT DISTINCT ?uri ?string
WHERE 
{       
        ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Bridge> .
        ?uri <http://dbpedia.org/property/design> ?design .
        <http://dbpedia.org/resource/Manhattan_Bridge> <http://dbpedia.org/property/design> ?manha . 
        FILTER (regex(?design, ?manha)).
        FILTER (?uri != <http://dbpedia.org/resource/Manhattan_Bridge>)> . 
        OPTIONAL {?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string. FILTER (lang(?string) = 'en') }
}

SELECT ?uri ?string
WHERE 
{       
        <http://dbpedia.org/resource/Annapurna> <http://dbpedia.org/ontology/elevation> ?elev .
        ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Mountain> . 
        ?uri <http://dbpedia.org/ontology/elevation> ?all .
        FILTER (?all < ?elev) .
        OPTIONAL {?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string. FILTER (lang(?string) = 'en') } 
} ORDER BY DESC(?all) LIMIT 1

SELECT DISTINCT ?uri 
WHERE 
{
         {<http://dbpedia.org/resource/Kansas> <http://dbpedia.org/property/north> ?string.}
         UNION
         {<http://dbpedia.org/resource/Kansas> <http://dbpedia.org/property/north>east> ?string.}
         UNION
         {<http://dbpedia.org/resource/Kansas> <http://dbpedia.org/property/south> ?string.}
         UNION
         {<http://dbpedia.org/resource/Kansas> <http://dbpedia.org/property/south>east> ?string.}
         UNION
         {<http://dbpedia.org/resource/Kansas> <http://dbpedia.org/property/east> ?string.}
         UNION
         {<http://dbpedia.org/resource/Kansas> <http://dbpedia.org/property/west> ?string.}
}

SELECT DISTINCT ?uri ?string
WHERE 
{
	?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/City> .
        ?uri <http://dbpedia.org/property/subdivisionName> ?location .
        FILTER (regex(?location, 'New Jersey')) .
        ?uri <http://dbpedia.org/property/populationTotal> ?inhabitants .
        FILTER (?inhabitants > 100000) .
        OPTIONAL {?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string. FILTER (lang(?string) = 'en') }
}

SELECT DISTINCT ?uri ?string
WHERE 
{       
        ?cave <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/ontology/Cave> . 
        ?cave <http://dbpedia.org/ontology/location> ?uri .
        OPTIONAL {?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string. FILTER (lang(?string) = 'en') }
} HAVING (count(?cave) > 2)

SELECT DISTINCT ?uri ?string
WHERE 
{
        ?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/class/yago/StatesOfTheUnitedStates> .
        ?uri <http://dbpedia.org/property/mineral> ?mineral .
        FILTER (regex(?mineral,'Gold')) .
        OPTIONAL {?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string. FILTER (lang(?string) = 'en') }
}

SELECT DISTINCT ?uri ?string
WHERE 
{
	?uri <http://www.w3.org/1999/02/22-rdf-syntax-ns#type> <http://dbpedia.org/class/yago/PresidentsOfTheUnitedStates> .
        ?uri <http://dbpedia.org/ontology/child> ?child .
        OPTIONAL {?uri <http://www.w3.org/2000/01/rdf-schema#label> ?string. FILTER (lang(?string) = 'en') }
} HAVING (count(?child) > 3)
